<!DOCTYPE html>
<script src="https://cdn.jsdelivr.net/gh/kitao/pyxel/wasm/pyxel.js"></script>
<script>
// htmlへ追加するjavascript

// userAgent取得
function getUserAgent()
{
	var userAgent = navigator.userAgent;
	if ("ontouchend" in document)
	{
		// ontouchendを付けちゃおう
		userAgent = "ontouchend" + userAgent;
	}
	return userAgent;
}

// とりあえずタッチしてる数だけ取っとく
var nowTouchCount = 0
// マルチタップ判定用のイベント
function setTouchHandler()
{
	let touchStartHandler = (event) => {
		event.preventDefault();     // デフォルトイベントキャンセル
		nowTouchCount = event.touches.length
	};

	// タッチエンド、キャンセルどっちでも呼ぶ
	let touchEndHandler = (event) => {
		event.preventDefault();     // デフォルトイベントキャンセル
		nowTouchCount -= event.touches.length
		if (nowTouchCount < 0)
		{
			nowTouchCount = 0;
		}
	};

	document.addEventListener("touchstart", touchStartHandler, { passive: false });
	document.addEventListener("touchend", touchEndHandler, { passive: false });
	document.addEventListener("touchcancel", touchEndHandler, { passive: false });
}

function getNowTouchCount()
{
	return nowTouchCount;
}

</script>
